import { BrowserRouter, useNavigate, Link  } from "react-router-dom"

function NotFound() {

  return (
    <div className="user">
        <p> Groups </p>
        <Link to={`/group/1`}>{ "Music 1" } </Link>
        <Link to={`/group/2`}>{ "Music 2" } </Link>
        <Link className="" to="/group/5"> Games 5 </Link>
        <LogoutUser />
    </div>
  );
}

export default NotFound;


